import React from "react";
import { Switch, Route as ARoute, Redirect } from "react-router-dom";

import Index from "../pages/MainTab/index";
import BottomTab01 from "../components/layout/BottomTab01";

const Route = ({ match }) => {
  return (
    <>
      <Switch>
        <ARoute exact path={`${match.url}/index`} component={Index} />
        <Redirect from={`*`} to={`${match.url}/index`} />
      </Switch>
      <BottomTab01 />
    </>
  );
};

export default Route;
